import React from "react";

import Paper from "@mui/material/Paper";

import ListItemText from "@mui/material/ListItemText";

// import List from '@mui/material/List';
import ListItem from "@mui/material/ListItem";
import Link from "@mui/material/Link";
import { gridSpacing } from "store/constant";

import { Divider, Grid, Typography, Button } from "@mui/material";

// project imports
import SubCard from "ui-component/cards/SubCard";
import Accordion from "ui-component/extended/Accordion";
import MainCard from "ui-component/cards/MainCard";
import SecondaryAction from "ui-component/cards/CardSecondaryAction";

// assets
import ArrowDropDownIcon from "@mui/icons-material/ArrowDropDown";
import FaceTwoToneIcon from "@mui/icons-material/FaceTwoTone";
import DomainTwoToneIcon from "@mui/icons-material/DomainTwoTone";
import FastfoodIcon from "@mui/icons-material/Fastfood";
import AccessTimeIcon from "@mui/icons-material/AccessTime";
import AltRouteIcon from "@mui/icons-material/AltRoute";
import HelpIcon from "@mui/icons-material/Help";
import Center from "react-center";
import Swal from "sweetalert2";

const request = () => {
  Swal.fire({
    icon: "success",
    title: "Gracias",
    text: "Tu requerimiento ha sido Recibido!",
    footer: "Un Agente se pondrá en contacto a la brevedad",
  });
};

export default function FdaRegister() {
  return (
    <div>
      {" "}
      <Grid container spacing={gridSpacing}>
        <Grid item xs={12} sm={6}>
          <SubCard title="Paso 1: ¿Por qué necesita estar registrado en la FDA?">
            <Typography variant="body2" sx={{ textAlign: "justify" }}>
              Tanto las instalaciones estadounidenses como las extranjeras que
              procesan, envasan o transportan alimentos humanos o animales para
              su consumo en los Estados Unidos deben registrarse en la FDA como
              Instalación Alimentaria Extranjera, según la normativa de la FDA.
              Si una instalación alimentaria extranjera no tiene un consumidor o
              importador estadounidense dispuesto, el proveedor extranjero
              también debe designar a un agente en los Estados Unidos para que
              actúe como punto de contacto para la FDA. Global Import Agent
              actuará como su punto de contacto con la FDA, y podremos
              registrarlo y comunicarnos con ellos en su nombre. Le
              proporcionaremos una prueba de registro por escrito, así como su
              número de registro una vez que se haya registrado. Esto puede
              utilizarse para demostrar que la instalación está debidamente
              autorizada a los agentes de aduanas, importadores y otros. Antes
              de empezar a importar su producto a los Estados Unidos, debe
              incluir su número de identificación en las notificaciones previas.
              Cada año par, la Ley de Modernización de la Seguridad Alimentaria
              (FSMA) permite a todas las instalaciones alimentarias volver a
              registrarse en la FDA. Mantendremos su registro bienal por usted y
              serviremos como su punto de contacto con la FDA una vez que le
              hayamos registrado. Traducción realizada con la versión gratuita
              del traductor www.DeepL.com/Translator
            </Typography>
            <Center>
              <Button onClick={request} variant="contained">
                Solicitar Servicio
              </Button>
            </Center>
          </SubCard>
        </Grid>
      </Grid>
    </div>
  );
}
